script: |
  super -f text -I q750.spq | sort > q750.out

inputs:
  - name: q750.spq
    data: |
      SELECT DISTINCT - - col2 * + col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN 82 + CAST ( - CAST ( NULL AS INTEGER ) AS REAL ) AND - CAST ( NULL AS REAL ) * - col0;
  - name: tab2

outputs:
  - name: q750.out
    data: |
